import React from "react";
import { NavLink } from "react-router-dom";
import HomeIcon from '@mui/icons-material/Home';
import PersonIcon from '@mui/icons-material/Person';
import DescriptionIcon from '@mui/icons-material/Description';
import InsightsIcon from '@mui/icons-material/Insights';
// import './css/nav.css'
const Nav = () => {
  return (
    <>
     <div className="nav_main navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container">
          <div className="navbar-brand">RC</div>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <div className="navbar-nav ms-auto mb-2 mb-lg-0">
              <NavLink exact activeClassName="active_class" to="/" className="nav-link">
                <HomeIcon className="navicon" /> Home
              </NavLink>
              <NavLink exact activeClassName="active_class" to="/about" className="nav-link">
                <PersonIcon className="navicon" /> About
              </NavLink>
              <NavLink exact activeClassName="active_class" to="/projects" className="nav-link">
                <InsightsIcon className="navicon" /> Projects
              </NavLink>
              <NavLink exact activeClassName="active_class" to="/resume" className="nav-link">
                <DescriptionIcon className="navicon" /> Resume
              </NavLink>
            </div>
          </div>
        </div>
      </div>    </>
  );
};

export default Nav;
